import React from 'react';
import Development from './Development.gif'

const HomePage = () => {



  return (

    <div>

      <image src={Development}></image>
      <img 
          className='check_list'
          src={Development} 
          alt='check-list' 
          height={800} width={1000}>
        </img>
      
    </div>
    
  )
}

export default HomePage
